import {link} from 'react-router-dom';

function Navbar() {
    return(
        <>
         <nav className = "navbar"></nav>
         <div className = "navbar-container">
            <link to="/" className="navbar-logo">
                DEMO <i className='fab-fa-typo3' />
            </link> 
         </div>
        </>
    )
}
export default Navbar
